function HomePage(state, action) {
  switch (action.type) {
    case "INCREMENT":
      return { count: state.count + 1 };
    case "DECREMENT":
      return { count: state.count - 1 };
    case "REPLACE":
      return { count: action.newCount };
    case "RESET":
      return { count: 0 };
    default:
      return state;
  }
}

const reducer = {
  HomePage
};

export default reducer;
